import React, { useState } from "react";
import Card from './Card'

const StudentCard = (props) => {

    return (
        <>
        {
            props.studentk.map(student =>
                <Card
                    id={props.studentK.studentNum}
                />
            )
        }
        </>
    )

}

export default StudentCard;
